script: |
  super -f text -I q8570.spq | sort > q8570.out

inputs:
  - name: q8570.spq
    data: |
      SELECT col1 FROM tab0 (FORMAT parquet) WHERE NOT - 68 / + col0 - - 33 - + CAST ( + col2 AS INTEGER ) * + col0 NOT BETWEEN NULL AND + 39 - col0 + - 8 * col2;
  - name: tab0

outputs:
  - name: q8570.out
    data: |
